import React from 'react';

const MovieListItem = ({title, poster}) => (
  <div>
  <p>
  {title}
  </p>
  <img alt={title} src={`https://image.tmdb.org/t/p/w500/${poster}`} />
  </div>
)

export default MovieListItem;
